import { Link, useParams } from "react-router-dom";

const EventDetail = () => {
  const params = useParams();
  return (
    <>
      <h1>EventDetail</h1>
      <p>{params.eventId}</p>
      <p>
        <Link></Link>
      </p>
    </>
  );
};

export default EventDetail;
